import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Button} from 'react-bootstrap';

const Home = () => {
  return (
    <div
      style={{
        justifyContent: 'center',
        justifyItems: 'center',
        display: 'flex',
      }}
    >
      <Card style={{width: '90%', margin: 20}}>
        <Card.Header as="h5">EXPLORE CANADA</Card.Header>
        <Form
          inline
          style={{
            paddingLeft: 20,
            paddingRight: 20,
            paddingTop: 10,
            paddingBottom: 10,
          }}
        >
          <Form.Group
            inline
            controlId="formGroupCheckIn"
            style={{marginLeft: 50}}
          >
            <Form.Label style={{fontSize: 14}}>Check In</Form.Label>
            <Form.Control type="date" placeholder="Start Date" />
          </Form.Group>
          <Form.Group controlId="formGroupCheckout" style={{marginLeft: 50}}>
            <Form.Label style={{fontSize: 14}}>Check Out</Form.Label>
            <Form.Control type="date" placeholder="End Date" />
          </Form.Group>
          <Button> Search</Button>
        </Form>
      </Card>
    </div>
  );
};
export default Home;
